//../johnbot/src/utils/htmlUtils.js
const addCss = (css) => {
    var head = document.getElementsByTagName('head')[0];
    var s = document.createElement('style');
    s.setAttribute('type', 'text/css');
    if (s.styleSheet) {
        s.styleSheet.cssText = css;
    } else {
        s.appendChild(document.createTextNode(css));
    }
    head.appendChild(s);
 }

 const addJs = (js) => {
    var head = document.getElementsByTagName('head')[0];
    var s = document.createElement('script');
    s.setAttribute('type', 'text/javascript');
    s.text = js;
    head.appendChild(s);
 }
//../johnbot/src/components/scannerBtnComponent.js
const scannerBtnComponent = () => {
  var added = false;
  var observer = new MutationObserver(function (mutations) {
    mutations.forEach(function (mutation) {
      let btn = document.querySelector('.main-li .pop-menu .scan');

      // REPLACE TO LOCAL REFERENCE
      // GM_addStyle(GM_getResourceText("scannerBtnCss"));

      const homePage = document.getElementsByClassName(
        'gheaderfooter-MuiGrid-root nav-icons gheaderfooter-MuiGrid-item gheaderfooter-MuiGrid-grid-xs-3 gheaderfooter-MuiGrid-grid-sm-2 gheaderfooter-MuiGrid-grid-md-5'
      )[0];
      const searchPage1 = document.getElementsByClassName(
        'MuiGrid-root nav-icons MuiGrid-item MuiGrid-grid-xs-3 MuiGrid-grid-md-4'
      )[0];
      const searchPage2 = document.getElementsByClassName(
        'MuiGrid-root nav-icons MuiGrid-item MuiGrid-grid-xs-3 MuiGrid-grid-sm-2 MuiGrid-grid-md-5'
      )[0];
      const docPage = document.getElementsByClassName(
        'gheaderfooter-MuiGrid-root nav-icons gheaderfooter-MuiGrid-item gheaderfooter-MuiGrid-grid-xs-3 gheaderfooter-MuiGrid-grid-md-4'
      )[0];

      var nav = getNav();
      var navType = getNavType();

      if (btn != null) {
        observer.disconnect();
      }

      if (nav != null && !added && btn == null) {
        added = true;
        observer.disconnect();
        var profileIcon = document.getElementsByClassName(
          'main-li pop-menu profile-icon'
        )[0];
        profileIcon.style.width = '35px';
        var scanIcon = document.createElement('li');
        scanIcon.className = 'main-li pop-menu scan';

        // REPLACE TO LOCAL REFERENCE
        // scanIcon.innerHTML = GM_getResourceText("scannerBtnHtml");
        var scanIconBtn = scanIcon.getElementsByTagName('button')[0];

        addJs('const getNavType = ' + getNavType.toString());
        addJs(
          'const changeUseCurrentSearchPage = ' +
            changeUseCurrentSearchPage.toString()
        );
        addJs(
          'const changeExtractKeywords = ' + changeExtractKeywords.toString()
        );
        addJs(
          'const changeScanThisPageOnly = ' + changeScanThisPageOnly.toString()
        );

        nav.querySelector('ul').appendChild(scanIcon);
        scanIconBtn.onclick = () => {
          scannerBtnDropdownComponent(scanIcon, navType);
        };

        if (
          navType == 'researchPage1' ||
          navType == 'searchPage1' ||
          navType == 'docPage1'
        ) {
          scanIcon.style.width = '30px';

          document
            .getElementsByClassName('main-li pop-menu profile-icon')[0]
            .firstChild.firstChild.getElementsByTagName('span')[1].innerText =
            'Me';

          var scannerContainer =
            document.getElementsByClassName('jbscannercontainer')[0];
          scannerContainer.style.width = '20px';
          scannerContainer.style.height = '20px';
          scannerContainer.style.border = '2px solid #393';
        } else {
          scanIcon.style.width = '36px';
        }
      }
    });
  });

  var observerConfig = {
    attributes: true,
    childList: true,
    characterData: true,
    subtree: true,
  };

  var targetNode = window.document.body;
  observer.observe(targetNode, observerConfig);
};

//../johnbot/src/components/scannerBtnDropdownComponent.js
const scannerBtnDropdownComponent = (scanIcon, navType) => {
  scanIcon = document.querySelector('.main-li.pop-menu.scan');
  var scanRect = scanIcon.getBoundingClientRect();

  window.addEventListener(
    'resize',
    (e) => {
      scanRect = scanIcon.getBoundingClientRect();
      document.querySelector('.scanTooltip').style.transform =
        'translate3d(' + (scanRect.x - 348) + 'px, 80px, 0px)';
    },
    true
  );

  if (document.querySelector('.scanTooltip') == null) {
    navType = getNavType();
    addDropdown(scanIcon, navType, scanRect);
  }

  window.addEventListener(
    'click',
    (e) => {
      var scanIcon = document.querySelector('.main-li.pop-menu.scan');
      var scanRect = scanIcon.getBoundingClientRect();
      if (scanIcon != null) {
        var nav = getNav();
        var navType = getNavType();

        if (
          e.target == scanIcon ||
          (scanIcon.contains(e.target) &&
            !(
              e.target == document.querySelector('.scanTooltip') ||
              document.querySelector('.scanTooltip').contains(e.target)
            ))
        ) {
          document.querySelector('#searchText').value = '';
          document.querySelector('#docCount').value = 10;
          document.querySelector('#extractStatistics').checked = true;
          document.querySelector('#extractFinancials').checked = true;
          document.querySelector('#extractReadershipAnalytics').checked = false;
          document.querySelector('#extractKeywords').checked = false;
          document.querySelector('#useCurrentSearchPage').checked = false;
          document.querySelector('#scanThisPageOnly').checked = false;
          changeUseCurrentSearchPage(navType);
          changeScanThisPageOnly();
          document.querySelector('#keywordsText').value = '';
          document.querySelector('#keywordsText').style.display = 'none';
          document.querySelector('#includingFromLinks').style.display = 'none';
          document.querySelector('#includingFromLinks').checked = false;
          document.querySelector('#includingFromLinksLabel').style.display =
            'none';
          document.querySelector('#caseSensitive').style.display = 'none';
          document.querySelector('#caseSensitive').checked = false;
          document.querySelector('#caseSensitiveLabel').style.display = 'none';

          dropdown(scanIcon, navType);

          if (navType == 'researchPage1' || navType == 'researchPage2') {
            document.querySelector('#scanThisPageOnly').style.display = 'none';
            document.querySelector('#scanThisPageOnlyLabel').style.display =
              'none';

            document.querySelector('#useCurrentSearchPage').style.display =
              'inline-block';
            document.querySelector(
              '#useCurrentSearchPageLabel1'
            ).style.display = 'inline-block';
            document.querySelector(
              '#useCurrentSearchPageLabel2'
            ).style.display = 'block';
          } else if (
            navType == 'homePage' ||
            navType == 'searchPage1' ||
            navType == 'searchPage2'
          ) {
            document.querySelector('#scanThisPageOnly').style.display = 'none';
            document.querySelector('#scanThisPageOnlyLabel').style.display =
              'none';

            let sP = document.querySelector('#useCurrentSearchPage');
            sP.style.display = 'none';
            sP.checked = false;
            changeUseCurrentSearchPage(navType);
            sP.classList.remove('disableInputBox');
            document.querySelector(
              '#useCurrentSearchPageLabel1'
            ).style.display = 'none';
            document.querySelector(
              '#useCurrentSearchPageLabel2'
            ).style.display = 'none';
          } else if (navType == 'docPage1' || navType == 'docPage2') {
            document.querySelector('#scanThisPageOnly').style.display =
              'inline-block';
            document.querySelector('#scanThisPageOnlyLabel').style.display =
              'inline-block';

            let sP = document.querySelector('#useCurrentSearchPage');
            sP.style.display = 'none';
            sP.checked = false;
            changeUseCurrentSearchPage(navType);
            sP.classList.remove('disableInputBox');
            document.querySelector(
              '#useCurrentSearchPageLabel1'
            ).style.display = 'none';
            document.querySelector(
              '#useCurrentSearchPageLabel2'
            ).style.display = 'none';
          }
        } else {
          if (
            e.target != document.querySelector('.scanTooltip') &&
            !document.querySelector('.scanTooltip').contains(e.target)
          ) {
            document.querySelector(
              '.scanTooltip .hdr-dropdown'
            ).style.opacity = 0;
            document
              .querySelector('.main-li.pop-menu.scan')
              .classList.remove('active');
            setTimeout(() => {
              document.querySelector('#searchText').value = '';
              document.querySelector('#docCount').value = 10;
              document.querySelector('#extractStatistics').checked = true;
              document.querySelector('#extractFinancials').checked = true;
              document.querySelector(
                '#extractReadershipAnalytics'
              ).checked = false;
              document.querySelector('#useCurrentSearchPage').checked = false;
              document.querySelector('#scanThisPageOnly').checked = false;
              changeUseCurrentSearchPage(navType);
              changeScanThisPageOnly();
              document.querySelector('#keywordsText').value = '';
              document.querySelector('#keywordsText').style.display = 'none';
              document.querySelector('#includingFromLinks').style.display =
                'none';
              document.querySelector('#includingFromLinks').checked = false;
              document.querySelector('#includingFromLinksLabel').style.display =
                'none';
              document.querySelector('#caseSensitive').style.display = 'none';
              document.querySelector('#caseSensitive').checked = false;
              document.querySelector('#caseSensitiveLabel').style.display =
                'none';
              document.querySelector('.scanTooltip').style.display = 'none';
            }, 350);
          }
        }
      }
    },
    true
  );
};

const addDropdown = (scanIcon, navType, scanRect) => {
  scanIcon = document.querySelector('.main-li.pop-menu.scan');
  GM_addStyle(GM_getResourceText('scannerBtnDropdownCss'));
  scanIcon.innerHTML += GM_getResourceText('scannerBtnDropdownHtml');
  const form = document.getElementById('scanForm');
  const dropDown = scanIcon.lastChild;
  dropDown.style.zIndex = '999999';
  dropDown.style.position = 'absolute';
  dropDown.style.top = '0px';
  dropDown.style.left = '0px';
  dropDown.style.transform =
    'translate3d(' + (scanRect.x - 348) + 'px, 80px, 0px)';

  if (navType == 'researchPage1' || navType == 'researchPage2') {
    document.querySelector('#scanThisPageOnly').style.display = 'none';
    document.querySelector('#scanThisPageOnlyLabel').style.display = 'none';

    document.querySelector('#useCurrentSearchPage').style.display =
      'inline-block';
    document.querySelector('#useCurrentSearchPageLabel1').style.display =
      'inline-block';
    document.querySelector('#useCurrentSearchPageLabel2').style.display =
      'block';
  } else if (
    navType == 'homePage' ||
    navType == 'searchPage1' ||
    navType == 'searchPage2'
  ) {
    document.querySelector('#scanThisPageOnly').style.display = 'none';
    document.querySelector('#scanThisPageOnlyLabel').style.display = 'none';

    let sP = document.querySelector('#useCurrentSearchPage');
    sP.style.display = 'none';
    sP.checked = false;
    sP.value = '';
    sP.classList.remove('disableInputBox');
    document.querySelector('#useCurrentSearchPageLabel1').style.display =
      'none';
    document.querySelector('#useCurrentSearchPageLabel2').style.display =
      'none';
  } else if (navType == 'docPage1' || navType == 'docPage2') {
    document.querySelector('#scanThisPageOnly').style.display = 'inline-block';
    document.querySelector('#scanThisPageOnlyLabel').style.display =
      'inline-block';

    let sP = document.querySelector('#useCurrentSearchPage');
    sP.style.display = 'none';
    sP.checked = false;
    sP.value = '';
    sP.classList.remove('disableInputBox');
    document.querySelector('#useCurrentSearchPageLabel1').style.display =
      'none';
    document.querySelector('#useCurrentSearchPageLabel2').style.display =
      'none';
  }

  setTimeout(() => {
    document.body.querySelector('.scanTooltip .hdr-dropdown').style.opacity = 1;
  }, 1);

  function handleForm(e) {
    e.preventDefault();
    runScan();
  }
  form.addEventListener('submit', handleForm);
};

const dropdown = (scanIcon, navType, scanRect) => {
  if (document.querySelector('.scanTooltip') == null) {
    scanRect = scanIcon.getBoundingClientRect();
    addDropdown(scanIcon, navType, scanRect);
  } else {
    if (document.querySelector('.scanTooltip').style.display != 'none') {
      toggleDropdown(false, navType);
    } else {
      toggleDropdown(true, navType);
    }
  }
};

const toggleDropdown = (isVisible, navType) => {
  if (document.querySelector('#useCurrentSearchPage').checked) {
    let searchText = document.querySelector('#searchText');
    if (
      searchText !=
      document.querySelector('.tui-jss1').querySelector('input').value
    ) {
      searchText.value = document
        .querySelector('.tui-jss1')
        .querySelector('input').value;
    }
  }

  if (navType == 'researchPage1' || navType == 'researchPage2') {
    document.querySelector('#scanThisPageOnly').style.display = 'none';
    document.querySelector('#scanThisPageOnlyLabel').style.display = 'none';

    document.querySelector('#useCurrentSearchPage').style.display =
      'inline-block';
    document.querySelector('#useCurrentSearchPageLabel1').style.display =
      'inline-block';
    document.querySelector('#useCurrentSearchPageLabel2').style.display =
      'block';
  } else if (
    navType == 'homePage' ||
    navType == 'searchPage1' ||
    navType == 'searchPage2'
  ) {
    document.querySelector('#scanThisPageOnly').style.display = 'none';
    document.querySelector('#scanThisPageOnlyLabel').style.display = 'none';

    let sP = document.querySelector('#useCurrentSearchPage');
    sP.style.display = 'none';
    sP.checked = false;
    sP.value = '';
    sP.classList.remove('disableInputBox');
    document.querySelector('#useCurrentSearchPageLabel1').style.display =
      'none';
    document.querySelector('#useCurrentSearchPageLabel2').style.display =
      'none';
  } else if (navType == 'docPage1' || navType == 'docPage2') {
    document.querySelector('#scanThisPageOnly').style.display = 'inline-block';
    document.querySelector('#scanThisPageOnlyLabel').style.display =
      'inline-block';

    let sP = document.querySelector('#useCurrentSearchPage');
    sP.style.display = 'none';
    sP.checked = false;
    sP.value = '';
    sP.classList.remove('disableInputBox');
    document.querySelector('#useCurrentSearchPageLabel1').style.display =
      'none';
    document.querySelector('#useCurrentSearchPageLabel2').style.display =
      'none';
  }

  if (!isVisible) {
    document.querySelector('.scanTooltip .hdr-dropdown').style.opacity = 0;
    document.querySelector('.main-li.pop-menu.scan').classList.remove('active');
    setTimeout(() => {
      document.querySelector('.scanTooltip').style.display = 'none';
    }, 350);
  } else {
    document.querySelector('.scanTooltip').style.display = 'flex';
    document.querySelector('.main-li.pop-menu.scan').classList.add('active');
    setTimeout(() => {
      document.querySelector('.scanTooltip .hdr-dropdown').style.opacity = 1;
    }, 1);
  }
};

const getNavType = () => {
  const homePage = document.getElementsByClassName(
    'gheaderfooter-MuiGrid-root nav-icons gheaderfooter-MuiGrid-item gheaderfooter-MuiGrid-grid-xs-3 gheaderfooter-MuiGrid-grid-sm-2 gheaderfooter-MuiGrid-grid-md-5'
  )[0];
  const searchPage1 = document.getElementsByClassName(
    'MuiGrid-root nav-icons MuiGrid-item MuiGrid-grid-xs-3 MuiGrid-grid-md-4'
  )[0];
  const searchPage2 = document.getElementsByClassName(
    'MuiGrid-root nav-icons MuiGrid-item MuiGrid-grid-xs-3 MuiGrid-grid-sm-2 MuiGrid-grid-md-5'
  )[0];
  const docPage = document.getElementsByClassName(
    'gheaderfooter-MuiGrid-root nav-icons gheaderfooter-MuiGrid-item gheaderfooter-MuiGrid-grid-xs-3 gheaderfooter-MuiGrid-grid-md-4'
  )[0];

  var nav;
  var navType;

  if (
    window.location.href.includes('https://www.gartner.com/search/research')
  ) {
    if (searchPage1 != null) {
      nav = searchPage1;
      navType = 'researchPage1';
    } else {
      nav = searchPage2;
      navType = 'researchPage2';
    }
  } else if (homePage != null) {
    if (!window.location.href.includes('https://www.gartner.com/document/')) {
      nav = homePage;
      navType = 'homePage';
    } else {
      nav = homePage;
      navType = 'docPage2';
    }
  } else if (searchPage1 != null) {
    nav = searchPage1;
    navType = 'searchPage1';
  } else if (searchPage2 != null) {
    nav = searchPage2;
    navType = 'searchPage2';
  } else if (docPage != null) {
    nav = docPage;
    navType = 'docPage1';
  } else {
  }

  return navType;
};

